import React, { Component } from 'react';
import About from './about';
import HomePage from './homepage';
import Contact from './contact';
import {Link} from 'react-scroll';

class Nav extends Component {
  render(){
   return (
      <div style={{color:'white',zIndex:4,position:'absolute',top:10}}>
      
       <Link
          activeClass="active"
          to="homepage"
          spy={true}
          smooth={true}
          offset={-70}
          duration= {500}
      >Homepage</Link>
       <Link
          activeClass="active"
          to="about"
          spy={true}
          smooth={true}
          offset={-70}
          duration= {500}
      >About</Link>
       <Link
          activeClass="active"
          to="contact"
          spy={true}
          smooth={true}
          offset={-70}
          duration= {500}
      >Contact</Link>
     
      
  </div>
    );
  }
}

export default Nav;
